DROP TABLE IF EXISTS employee CASCADE;
 create table employee (
	id SERIAL PRIMARY KEY,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(80),
	phone VARCHAR(15),
	job_title VARCHAR(100),
	branchId integer,
	managerId integer 
);
DROP TABLE IF EXISTS Leaves CASCADE;
 create table Leaves (
	id SERIAL PRIMARY KEY,
	employeeId Integer,
	LeaveDate date,
	LeaveId integer  
);
